import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation';
import Particles from 'react-particles-js';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';


const particulesOptions = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}
class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }
  onInputChange = (event) => {
    console.log(event.target.value);
  }
  onButtonSubmit() {
    console.log('click');
  }
  render() {
    return (
      <div className="App">
        <Particles className="particles" params={particulesOptions} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInpuntChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit} />
        { /*
       <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
